import { AiOutlineThunderbolt } from "react-icons/ai";
const CardData = [
    {
        id:1,
        images:"http://st.ourhtmldemo.com/new/Aircare/images/blog/lat-blog-3.jpg",
        icons:<AiOutlineThunderbolt className="icons"/>,
        Title:"A/C Installation",
        discription: "We offer high quality installation of residential & commercial..."
    },
    {
        id:2,
        images:"https://cdn.pixabay.com/photo/2019/02/06/16/32/architect-3979490_960_720.jpg",
        icons:<AiOutlineThunderbolt className="icons"/>,
        Title:"Maintenance & Repair",
        discription: "We provide a full range of repairing and maintenance of air..."
    }
]
export default CardData;
